/**
 * Get item name by ID
 */
export function getItemNameById(id: number): string | undefined {
  return ITEM_MAPPINGS[id]?.name;
}

/**
 * Get full item mapping by ID
 */
export function getItemById(id: number): ItemMapping | undefined {
  return ITEM_MAPPINGS[id];
}

/**
 * Get localized item name by ID and locale
 */
export function getLocalizedItemName(
  id: number,
  _locale: "en" | "cn" | "de" | "es" | "fr" | "ko" | "ru" = "en",
): string | undefined {
  // Localized names removed - only English name available
  return getItemNameById(id);
}

/**
 * Check if an item ID exists in the mapping
 */
export function hasItemMapping(id: number): boolean {
  return id in ITEM_MAPPINGS;
}
